import React from 'react';

function MatchResults({ formDataArray }) {
    return (
        <>
            <h1 style={{ textAlign: 'center' }}>All Matches </h1>
            <div
                style={{
                    display: 'grid',
                    gridTemplateColumns: 'repeat(auto-fill, minmax(200px, 1fr))',
                    gap: '70px',
                    alignItems: 'stretch',
                }}
            >
                <>
                    {formDataArray.length > 0 && (
                        <div>
                            <h2>Match Results</h2>
                            {formDataArray.map((formData, index) => (
                                <div key={index}>
                                    <h3>Week {formData.week}</h3>
                                    <p>Date: {formData.date}</p>
                                    <p>Team White Goalie: {formData.game.teamWhite.goalie}</p>
                                    <ul>
                                        {formData.game.teamWhite.players.map((player, index) => (
                                            <li key={index}>{player.name}</li>
                                        ))}
                                    </ul>
                                    <p>Team Black Goalie: {formData.game.teamBlack.goalie}</p>
                                    <ul>
                                        {formData.game.teamBlack.players.map((player, index) => (
                                            <li key={index}>{player.name}</li>
                                        ))}
                                    </ul>
                                </div>
                            ))}
                        </div>
                    )}
                </>
            </div>
        </>
    );
}

export default MatchResults;
